-- Name: v1_field_trial_master_summary; Type: VIEW; Schema: public; Owner: dad
--

CREATE VIEW public.v1_field_trial_master_summary AS
 SELECT ft.field_trial_key,
    count(DISTINCT ft.site_key) AS nbr_of_sites,
    count(DISTINCT ft.year_planted) AS years_planted,
    count(DISTINCT ft.ft_stock_type) AS nbr_of_stock_types,
    count(ft.test_spec_key) AS planted_qty,
    sum(ft.live_quantity) AS sum_live_qty,
    trunc(avg(ft.live_quantity), 2) AS avg_survival_rate,
    sum(pt.is_plus_tree) AS sum_plus_trees,
    trunc(avg(NULLIF(ft.live_dbh_cm, ('-1'::integer)::numeric)), 2) AS avg_dbh_cm,
    trunc(avg(ft.field_cuttings_ft), 2) AS avg_field_cuttings_ft,
    trunc(avg(ft.canker_score), 2) AS avg_canker_score,
    trunc(avg(ft.leaf_score), 2) AS avg_leaf_score,
    trunc(((((count(DISTINCT ft.site_key) * 3) + (sum(pt.is_plus_tree) * 2)))::numeric + (avg(ft.live_quantity) * (5)::numeric)), 2) AS sites_plustree_survival_score
   FROM public.avw_field_trial ft,
    ( SELECT field_trial.field_trial_key,
            field_trial.id,
                CASE
                    WHEN (field_trial.is_plus_ynu = 'Y'::bpchar) THEN 1
                    WHEN (field_trial.is_plus_ynu = 'N'::bpchar) THEN '-1'::integer
                    ELSE 0
                END AS is_plus_tree
           FROM public.field_trial) pt
  WHERE (((ft.field_trial_key)::text = (pt.field_trial_key)::text) AND (ft.id = pt.id))
  GROUP BY ft.field_trial_key
  ORDER BY (trunc(((((count(DISTINCT ft.site_key) * 3) + (sum(pt.is_plus_tree) * 2)))::numeric + (avg(ft.live_quantity) * (5)::numeric)), 2)) DESC;


