--
-- Name: vw_2019_5_nursery_field_summary; Type: VIEW; Schema: public; Owner: dad
--

CREATE VIEW public.vw_2019_5_nursery_field_summary AS
 SELECT ss.test_detail_key,
    ss.stock_type,
    ss.id_order,
    ss.rank_class,
    ss.todo,
    ss.selection_type,
    ss.nbr_of_replications,
    ss.sum_of_start_qty,
    ss.sum_of_end_qty,
    ss.sum_nursery_cuttings_ft,
    ft.sum_field_cuttings_ft,
    ss.sum_of_plus_trees,
    swt.avg_undulation_level,
    ss.avg_survival_rate,
    ss.avg_stock_dia_mm,
    ss.avg_collar_median_dia_mm,
    ss.avg_leaf_score,
    ss.avg_ar_score,
    ss.avg_stool_collar_mm,
    ss.stools_cut_fcut_reps,
    ss.cut_fcut_reps,
        CASE
            WHEN (ss.stock_type = 'MS'::bpchar) THEN dense_rank() OVER (ORDER BY ss.stools_cut_fcut_reps DESC)
            ELSE '-1'::bigint
        END AS stool_rank,
        CASE
            WHEN (ss.stock_type = 'DC'::bpchar) THEN dense_rank() OVER (ORDER BY ss.cut_fcut_reps DESC)
            ELSE '-1'::bigint
        END AS dc_rank,
        CASE
            WHEN (ss.stock_type = 'DCMS'::bpchar) THEN dense_rank() OVER (ORDER BY ss.cut_fcut_reps DESC)
            ELSE '-1'::bigint
        END AS dcms_rank,
        CASE
            WHEN (ft.archived_trees IS NULL) THEN (0)::numeric
            ELSE ft.archived_trees
        END AS archived_trees,
    fts.arc_avg_dbh_cm,
    ftms.ftms_nbr_of_sites,
    ftms.ftms_years_planted,
    ftms.ftms_nbr_of_stock_types,
    ftms.ftms_sites_plustree_survival_score,
    (((((((((((ss.test_detail_key)::text || '#rankdc= '::text) ||
        CASE
            WHEN (ss.stock_type = 'DC'::bpchar) THEN dense_rank() OVER (ORDER BY ss.cut_fcut_reps DESC)
            ELSE '-1'::bigint
        END) || '#reps='::text) || ss.nbr_of_replications) || '#srate='::text) || trunc(ss.avg_survival_rate, 2)) || '#avg_ar='::text) || ss.avg_ar_score) || '#avgleaf='::text) || ss.avg_leaf_score) AS dc_rankings_2019,
    ((((((((((nr.all_ms_dc_rankings || '#arc='::text) || ft.archived_trees) || '#arc_leaf='::text) || ft.arc_avg_leaf_score) || '#arc_dbh_leaf='::text) || fts.sum_score) || '#arc_avg_dbh='::text) || fts.arc_avg_dbh_cm) || 'avg17dbh_rank='::text) || ftms.ftms_sites_plustree_survival_score) AS all_dc_archived_score
   FROM (((((public.vw_2019_2_nursery_key_stock_summary ss
     LEFT JOIN ( SELECT avw_field_trial.field_trial_key,
            sum(avw_field_trial.live_quantity) AS archived_trees,
            sum(avw_field_trial.field_cuttings_ft) AS sum_field_cuttings_ft,
            trunc(avg(avw_field_trial.leaf_score), 2) AS arc_avg_leaf_score
           FROM public.avw_field_trial
          WHERE ((avw_field_trial.id_test_spec = 60) AND (avw_field_trial.year_planted = '2017'::bpchar))
          GROUP BY avw_field_trial.field_trial_key) ft ON (((ss.test_detail_key)::text = (ft.field_trial_key)::text)))
     LEFT JOIN ( SELECT va2_all_nursery_rankings.test_detail_key,
            va2_all_nursery_rankings.all_ms_dc_rankings
           FROM public.va2_all_nursery_rankings) nr ON (((ss.test_detail_key)::text = (nr.test_detail_key)::text)))
     LEFT JOIN ( SELECT v2_field_trial_test_spec_summary.field_trial_key,
            sum(v2_field_trial_test_spec_summary.sum_plus_dbh_leafscore) AS sum_score,
            trunc(avg(v2_field_trial_test_spec_summary.avg_dbh_cm), 2) AS arc_avg_dbh_cm
           FROM public.v2_field_trial_test_spec_summary
          WHERE ((v2_field_trial_test_spec_summary.id_test_spec = 60) AND (v2_field_trial_test_spec_summary.year_planted = '2017'::bpchar))
          GROUP BY v2_field_trial_test_spec_summary.field_trial_key) fts ON (((ss.test_detail_key)::text = (fts.field_trial_key)::text)))
     LEFT JOIN ( SELECT v1_field_trial_master_summary.field_trial_key,
            v1_field_trial_master_summary.nbr_of_sites AS ftms_nbr_of_sites,
            v1_field_trial_master_summary.years_planted AS ftms_years_planted,
            v1_field_trial_master_summary.nbr_of_stock_types AS ftms_nbr_of_stock_types,
            v1_field_trial_master_summary.sites_plustree_survival_score AS ftms_sites_plustree_survival_score
           FROM public.v1_field_trial_master_summary) ftms ON (((ss.test_detail_key)::text = (ftms.field_trial_key)::text)))
     LEFT JOIN ( SELECT gpf2_figured_wood_split_tests_summary.swt_key,
            gpf2_figured_wood_split_tests_summary.avg_undulation_level
           FROM public.gpf2_figured_wood_split_tests_summary) swt ON (((ss.test_detail_key)::text = (swt.swt_key)::text)))
  ORDER BY ss.cut_fcut_reps DESC;


ALTER TABLE public.vw_2019_5_nursery_field_summary OWNER TO dad;

