-- Name: vw_2019_nursery_field_clone_summary; Type: VIEW; Schema: public; Owner: dad
--

CREATE VIEW public.vw_2019_nursery_field_clone_summary AS
 SELECT td.test_detail_key,
    sum(td.nursery_cuttings_ft) AS sum_nursery_cuttings_ft,
    min(vwfs.sum_field_cuttings_ft) AS sum_field_cuttings_ft,
    min(vwfs.sum_of_plus_trees) AS nursery_plus_trees,
    (min(td.nursery_cuttings_ft) + min(vwfs.sum_field_cuttings_ft)) AS total_cuttings_ft,
    max((p.alba_class)::text) AS alba_class,
    max(td.selection_type) AS selection_type,
    min(vwfs.arc_avg_dbh_cm) AS field_avg_dbh_cm,
    min(vwfs.archived_trees) AS field_trees,
    min(vwfs.ftms_sites_plustree_survival_score) AS ftms_sites_plustree_survival_score,
    min(vwfs.dc_rankings_2019) AS dc_rankings_2019,
    min(vwfs.all_dc_archived_score) AS all_dc_archived_score
   FROM ((public.avw_test_detail td
     LEFT JOIN ( SELECT vw_2019_5_nursery_field_summary.test_detail_key,
            vw_2019_5_nursery_field_summary.sum_field_cuttings_ft,
            vw_2019_5_nursery_field_summary.dcms_rank,
            vw_2019_5_nursery_field_summary.arc_avg_dbh_cm,
            vw_2019_5_nursery_field_summary.archived_trees,
            vw_2019_5_nursery_field_summary.dc_rankings_2019,
            vw_2019_5_nursery_field_summary.all_dc_archived_score,
            vw_2019_5_nursery_field_summary.sum_of_plus_trees,
            vw_2019_5_nursery_field_summary.ftms_sites_plustree_survival_score
           FROM public.vw_2019_5_nursery_field_summary) vwfs ON (((td.test_detail_key)::text = (vwfs.test_detail_key)::text)))
     LEFT JOIN ( SELECT plant.plant_key,
            plant.alba_class
           FROM public.plant) p ON ((upper((td.test_detail_key)::text) = upper((p.plant_key)::text))))
  WHERE ((td.test_spec_key)::text = ANY ((ARRAY['2019-PostNE-West-Measurement'::character varying, '2019-bell-nursery'::character varying])::text[]))
  GROUP BY td.test_detail_key
  ORDER BY (min(vwfs.ftms_sites_plustree_survival_score)) DESC NULLS LAST, (sum(td.nursery_cuttings_ft)) DESC;


